import React from 'react'

function Sessions({ sessionSelection }) {
    const session = ["Frontend Devlopment", "Backend Development", "FullStack Development"];
    return (
        <div className=' flex justify-around py-5 mx-5 text-white font-semibold'>

            {session.map((sessions, index) => {
                return <div
                    key={index}
                    onClick={() => sessionSelection(sessions)}
                    className='bg-sky-700 rounded-md p-2 cursor-pointer hover:bg-sky-500'
                >{sessions}</div>
            })}
        </div>
    )
}

export default Sessions
